// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./ZombieFeeding.sol";

contract ZombieHelper is ZombieFeeding {
    modifier aboveLevel(uint _level, uint _zombieId) {
        require(zombies[_zombieId].level >= _level, "Need higher level");
        _;
    }
    function changeName(uint _zombieId, string memory _newName) external aboveLevel(2, _zombieId) {
        require(msg.sender == zombieToOwner[_zombieId], "Not your zombie");
        zombies[_zombieId].name = _newName;
    }
    function levelUp(uint _zombieId) external payable {
        require(msg.value == 0, "Free in demo");
        zombies[_zombieId].level++;
    }

    function getZombiesByOwner(address _owner) external view returns (uint[] memory) {
        uint c = 0;
        for (uint i = 0; i < zombies.length; i++) if (zombieToOwner[i] == _owner) c++;
        uint[] memory result = new uint[](c);
        uint idx = 0;
        for (uint i = 0; i < zombies.length; i++) if (zombieToOwner[i] == _owner) { result[idx++] = i; }
        return result;
    }
}
